import { Routes, Route, useNavigate } from "react-router-dom";
import React, { useState, useEffect } from "react";
import Home from "./Home";
import Signup from "./Signup";
import Usermemes from "./Usermemes";
import Navbar from "./Navbar";
import Memes from "./Memes";
function App() {
  const [username, setUsername] = useState("");
  const [userId, setUserId] = useState("");
  const [memes, setMemes] = useState([]);
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [userMemes, setUserMemes] = useState([]);
  const [search, setSearch] = useState("");

  const navigate = useNavigate();
  console.log(userMemes)

  const handleLogin = (e) => {
    e.preventDefault();
    const form = e.target;
    const formData = new FormData(form);

    fetch("http://127.0.0.1:9292/login", {
      method: "POST",
      body: formData,
    })
      .then((response) => {
        if (response.ok) {
          return response.json();
        } else {
          throw new Error("Network error.");
        }
      })
      .then((data) => {
        setIsAuthenticated(true);
        setUsername(data.username);
        setUserId(data.userId);
        navigate("/memes");
      })
      .catch((error) => {
        console.error("There was a problem with the fetch operation:", error);
      });
  };
 console.log(userId)
  const handleLogout = (e) => {
    e.preventDefault();
    fetch("http://localhost:9292/logout", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
    })
      .then((response) => {
        if (response.ok) {
          setIsAuthenticated(false);
          navigate("/");
        } else {
          throw new Error("Failed to logout");
        }
      })
      .catch((error) => console.error(error));
  };


  useEffect(() => {
    fetch("http://localhost:9292/memes")
      .then((r) => r.json())
      .then((response) => setMemes(response.memes));
  }, []);


  useEffect(() => {
    fetch(`http://localhost:9292/user_memes/${userId}`)
      .then((response) => response.json())
      .then((data) => {
        setUserMemes(data.memes);
      })
      .catch((error) => console.error(error));
  }, [userId]);

  const handleSearchChange = (value) => {
    setSearch(value);
  };

  const displayedMemes = memes.filter((meme) =>
    meme.title.toLowerCase().includes(search.toLowerCase())
  );

  const renderUsermemes = () => {
    if (isAuthenticated) {
      return (
        <Usermemes
          userId={userId}
          userMemes={userMemes}
          setUserMemes={setUserMemes}
          handleDeleteMeme={handleDeleteMeme}
          handleAddMeme={handleAddMeme}
          handleUpdateMeme={handleUpdateMeme}
        />
      );
    } else {
      navigate("/login");
    }
  };


  const handleEditMeme = (id, updatedMeme) => {
    fetch(`http://localhost:9292/users/${userId}/memes/${id}`, {
      method: 'PATCH',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(updatedMeme)
    })
      .then(response => {
        if (response.ok) {
          // Update the meme in the state
          const updatedMemes = myMemes.map(meme => {
            if (meme.id === id) {
              return { ...meme, ...updatedMeme };
            }
            return meme;
          });
          setMyMemes(updatedMemes);
        } else {
          throw new Error('Network response was not ok.');
        }
      })
      .catch(error => {
        console.error('There was a problem with the fetch operation:', error);
      });
  };

  const handleDeleteMemes = (id) => {
    const updatedMemes = myMemes.filter(meme => meme.id !== id);
    setMyMemes(updatedMemes);
  };

  const handleAddMemes = (newMeme) => {
    setMyMemes([...myMemes, newMeme]);
  };

  return (
    <div className="">

        <Navbar isAuthenticated={isAuthenticated} handleLogout={handleLogout} username={username} />

        <Routes>
           <Route path="/" element={<Home setIsAuthenticated={setIsAuthenticated}  isAuthenticated={isAuthenticated} handleLogin={handleLogin}/>} />
           <Route path="/signup" element={<Signup setIsAuthenticated={setIsAuthenticated}  />} />
           {isAuthenticated && (
            <>
              <Route path="/memes" element={<Memes memes={displayedMemes} displayedMemes={displayedMemes} handleSearchChange={handleSearchChange}/>} />
              <Route path="/usermemes" element={Usermemes()}/>
            </>
           )}
        </Routes>
   </div>
  );
}

export default App;
